package com.wry.dynamicproxy;	import java.lang.reflect.Method; 	public class $Proxy implements com.wry.dynamicproxy.Moveable {	    com.wry.dynamicproxy.InvocationHandler ih;	    public $Proxy(InvocationHandler ih) {	        this.ih = ih;	    }	    @Override	    public void moveable() {	       try{	           Method md = com.wry.dynamicproxy.Moveable.class.getMethod("moveable");	           ih.invoke(md);	       }catch(Exception e){e.printStackTrace();}	    }}